import React from 'react'
import { Link } from 'react-router-dom'
import profilesdata from './profilesdata'

function Profiles() {

    const allProfiles = profilesdata.map(profile => {
        return(
            <div>
                <h2>
                    <Link to={profile._id}>{profile.name}</Link> - {profile.price}
                </h2>
            </div>
        )
    })

  return (
    <div>
      <h1>Profiles</h1>
      {allProfiles}
    </div>
  )
}

export default Profiles
